import React from "react";
import { Link } from "react-router-dom";
import "./Watch.css";

export default class Header extends React.Component {
  render() {
    return (
      <div className="watch-container">
        <input type="file" accept="video/*" />
        <div>
          <video controls autoplay />
        </div>
      </div>
    );
  }
}
